  const handleSubmit=()=>{

  }
  return (
    <Wrapper>

    <h1>Fill the application</h1>
    <Left>

    <Form>
            <Input
              onChange={handleInput}
              name="first_name"
              placeholder="First Name"
              type="text"
              />
            <Input
              onChange={handleInput}
              name="last_name"
              placeholder="Last Name"
              type="text"
              />
            <Input
              onChange={handleInput}
              name="email"
              placeholder="email"
              type="email"
              />
            <Input
              onChange={handleInput}
              name="password"
              placeholder="password"
              type="password"
              />
            <Input
              onChange={handleInput}
              name="dob"
              placeholder="DOB (date of birth)"
              type="date"
              />
            <Box>
              Choose your picture
            <Input
              onChange={handleInput}
              name="dob"
              type="file"
              />
              </Box>
            <Agreement>
              By creating an account, I consent to the processing of my personal
              data in accordance with the <b>PRIVACY POLICY</b>
            </Agreement>
            <Button disabled={auth.isLoading} onClick={handleSubmit}>
              CREATE
            </Button>

            <Text>
             <Link to="/signup" className="links">ALREADY HAVE A ACCOUNT?</Link>
            </Text>
            {auth.isFailure && <Error>{auth.message}</Error>}
          </Form>
              </Left>
              <Right>

              </Right>
    </Wrapper>
  )
}

export default Home
